import classes from "./CollegeDegrees.module.css";
import iitlogo2 from "../../../assets/iitlogo2.png";
import icon from '../../../assets/list_icon.svg';

const CollegeDegrees = () => {
  return (
    <div className={classes.degree}>
      <h2>Degrees Recieved</h2>
      <img src={iitlogo2} />
      <div className={classes.college}>
        <div className={classes.name}>
          <h3>Indian Institute of Technology Patna</h3>
          <h4>M.Tech in Computer Science</h4>
          <p>2019 - 2021</p>
          {/* <ul>
          <li>Coffee</li>
          <li>Tea</li>
          <li>Coca Cola</li>
        </ul> */}
          <img src={icon} />
        </div>
      </div>
    </div>
  );
};

export default CollegeDegrees;
